      $('#imgi1-dark, #imgi2-dark, #imgi3-dark').css('display', 'block');
      } 
      else {
      document.documentElement.setAttribute('data-theme', 'light');
      if (window.innerWidth > 480){
         $('.profile').attr('src', (src = `${Whitemoji2}`));
      }
      else{
         $('.profile').attr('src', (src = `${Whitemoji123}`));
